import React from "react";
import './App.css';

function LoginPage(){
    return(
        <div className="login">
            <h1>[ LOGO ]</h1>
            <h1>AniRec</h1>

            <button onClick>Login</button>
            <button onClick>Register</button>

        </div>
    );
}

export default LoginPage;
